import styled from "styled-components";
import CustomerChart from "../comps/Home/CustomerChart";

const Container = styled.div`
  display: flex;
  justify-content: space-between;

  .currentCustomers {
    flex-basis: 60%;
    background-color: lightgrey;
  }
`;

function Home() {
  return (
    <>
      <div className="Home">
        <h1>Basic CRM</h1>
        <hr />
        <Container>
          <div className="currentCustomers">
            <CustomerChart />
          </div>
          <div className="quickAddCustomer">Quick Add</div>
        </Container>
      </div>
    </>
  );
}

export default Home;
